// Create data

const SaksFifth = mongoose.Schema({
  product_name: String,
  brand: String,
  color: Array,
  details: {
    head: {type: String},
    bullet: {type: String},
    size: {type: String},
    style: {type: String}
  },
  images: Array,
  price: Number,
  size: Array
}, {
  versionKey: false 
});
SaksFifth.plugin(random);

const Product = mongoose.model('Product', SaksFifth)

var populateSchema = () => {
  for (var i = 0; i < names.length; i++) {
    Product.create({
      product_name: names[i],
      brand: brand[i],
      color: color[i],
      details: details[i],
      images: images[i],
      price: price[i],
      size: size[i]
    })
  }
}
populateSchema()

module.exports = Product